INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, "春咲 ひより", 0, 0, 0, 0, 1, 1, 1.4, 0, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 1001);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("みんなみたいに\nわたしも強くならなきゃ", 2, "草野 優衣", 0, 0, 0, 0, 1, 1, 1.4, 0, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 1002);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("フェンシングを始めてみては？", 2, "士条 怜", 0, 0, 0, 0, 1, 1, 1.4, 0, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", 1, 1003);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ねぇ、にいちゃん！", 2, "穂高 みそぎ", 0, 0, 0, 0, 1, 1, 1.5, 0, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", 1, 1004);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("風宮あかりです", 2, "風宮 あかり", 0, 0, 0, 0, 1, 1, 1.4, 0, "ねぇ…", "私といっしょに…\nいかない？", 1, 1006);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("出雲宮子なのー", 2, "出雲 宮子", 0, 0, 0, 0, 1, 1, 1.5, 0, "プリンたべたいのー", "食べ物の恨みは怖いのー", 1, 1007);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ボクは虹村雪。", 2, "虹村 雪", 0, 0, 0, 0, 1, 1, 1.4, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", 1, 1008);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("フッ…聞いて後悔するがいい！", 2, "柊杏奈", 0, 0, 0, 0, 1, 1, 1.4, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", 1, 1009);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("マホマホ王国のプリンセス、\nまほ姫どす", 2, "姫宮 真歩", 0, 0, 0, 0, 1, 1, 1.5, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", 1, 1010);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("衣之咲璃乃です！", 2, "衣之咲 璃乃", 0, 0, 0, 0, 1, 1, 1.4, 0, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", 1, 1011);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, "柏崎 初音", 0, 0, 0, 0, 1, 1, 1.4, 0, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", 1, 1012);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ちょす！\n美波鈴奈だよ～♪", 2, "美波 鈴奈", 0, 0, 0, 0, 1, 1, 1.4, 0, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 1016);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("はいたーい。\n喜屋武香織さー。", 2, "喜屋武 香織", 0, 0, 0, 0, 1, 1, 1.4, 0, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", 1, 1017);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("支倉伊緒です。", 2, "支倉 伊緒", 0, 0, 0, 0, 1, 1, 1.4, 0, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。", 1, 1018);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, "茜 ミミ", 0, 0, 0, 0, 1, 1, 1.5, 0, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", 1, 1020);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あ…あの…えっと…\n栗…林…くるみ…です……", 2, "栗林 くるみ", 0, 0, 0, 0, 1, 1, 1.5, 0, "あの……\nふぇ……", "ふぇぇぇぇぇん……", 1, 1021);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("風宮よりです。\nあああああ！", 2, "風宮 より", 0, 0, 0, 0, 1, 1, 1.4, 0, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", 1, 1022);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, "北条 綾音", 0, 0, 0, 0, 1, 1, 1.5, 0, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", 1, 1023);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("わっ…わっ…私、\n天野すずめといいます！", 2, "天野 すずめ", 0, 0, 0, 0, 1, 1, 1.4, 0, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", 1, 1025);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("……クスクス…私は\n…倉石恵理子……", 2, "倉石 恵理子", 0, 0, 0, 0, 1, 1, 1.4, 0, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", 1, 1027);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, "佐々木 咲恋", 0, 0, 0, 0, 1, 1, 1.4, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", 1, 1028);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("桜井望だよ！\nよろしくねっ", 2, "桜井 望", 0, 0, 0, 0, 1, 1, 1.4, 0, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", 1, 1029);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("デケデケデンっ！", 2, "ニノン・ジュベール", 0, 0, 0, 0, 1, 1, 1.4, 0, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", 1, 1030);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("上喜しのぶです。\n手元のドクロが父です。", 2, "上喜 しのぶ", 0, 0, 0, 0, 1, 1, 1.4, 0, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……", 1, 1031);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("目指すはビッグな\nお笑い芸人だっぺ！", 2, "野戸まひる", 0, 0, 0, 0, 1, 1, 1.5, 0, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！", 1, 1033);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, "綾瀬 ゆかり", 0, 0, 0, 0, 1, 1, 1.4, 0, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！", 1, 1034);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("氷川鏡華…です", 2, "氷川 鏡華", 0, 0, 0, 0, 1, 1, 1.5, 0, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！", 1, 1036);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("柏崎…栞です。", 2, "柏崎 栞", 0, 0, 0, 0, 1, 1, 1.4, 0, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 1038);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("ふ、双葉碧です。", 2, "双葉 碧", 0, 0, 0, 0, 1, 1, 1.4, 0, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。", 1, 1040);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("三角千歌です。", 2, "三角 千歌", 0, 0, 0, 0, 1, 1, 1.4, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。", 1, 1042);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("安芸真琴だ。", 2, "安芸 真琴", 0, 0, 0, 0, 1, 1, 1.4, 0, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…", 1, 1043);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("わらわこそは夜を総べる者！", 2, "イリヤ・オーンスタイン", 0, 0, 0, 0, 1, 1, 1.4, 0, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 1044);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("そこで騎士は妖精を乱暴に……", 2, "遠見 空花", 0, 0, 0, 0, 1, 1, 1.4, 0, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?", 1, 1045);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, "宮坂たまき", 0, 0, 0, 0, 1, 1, 1.4, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪", 1, 1046);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("大神美冬よ！", 2, "大神 美冬", 0, 0, 0, 0, 1, 1, 1.4, 0, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 1048);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("星野静流だよ！", 2, "星野静流", 0, 0, 0, 0, 1, 1, 1.4, 0, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 1049);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("アタシは玉泉美咲。", 2, "玉泉美咲", 0, 0, 0, 0, 1, 1, 1.5, 0, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1, 1050);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("？？？", 2, "リマ", 0, 0, 0, 0, 1, 1, 1.4, 0, "？？？？", "？？？？", 1, 1052);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("モニカ・ヴァイスヴィントだ。", 2, "モニカ・ヴァイスヴィント", 0, 0, 0, 0, 1, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1, 1053);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("モニカ・ヴァイスヴィントだ。", 2, "ペコリーヌ", 0, 0, 0, 0, 1, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1, 1058);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("モニカ・ヴァイスヴィントだ。", 2, "コッコロ", 0, 0, 0, 0, 1, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1, 1059);
INSERT INTO `v1_a5d37ce9d5235b4ebd95babfcc0f900bb65f30d26865f470e790ec0a4273e706` VALUES ("モニカ・ヴァイスヴィントだ。", 2, "キャル", 0, 0, 0, 0, 1, 1, 1.5, 0, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", 1, 1060);
